import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('forward', () => {
    test('ok', async () => {
        const r1 = await request('http://forward.test.whistlejs.com/index.html');
        expect(r1.data).toHaveProperty('type', 'server');
        const r2 = await request({
            method: 'post',
            url: 'http://forward.test.whistlejs.com/index.html'
        });
        expect(r2.data).toHaveProperty('type', 'server');
    });
});
